(1,48,52,'<p>Hi,</p><p>&nbsp;</p><p>Good day!</p><p>&nbsp;</p><p>This is regarding your warranty claim at Curtis International Ltd.</p><p>For us to serve you better, we will need the following information.</p><p>&nbsp;</p><p>1. &nbsp; &nbsp; &nbsp;&nbsp;<strong>A clear and readable picture of the bill of sale.</strong>&nbsp; Please note the bill of sale must show the following:</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>&nbsp;</strong>Store Name and Address&nbsp;<i>*except if purchased online</i></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Date of purchase</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Item description</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Unit Price</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Total amount paid</p><p>If you do not have the bill of sale, you may try contacting the dealers customer care department&nbsp; for added support.</p><p>2.&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>A clear picture of the front of the unit</strong> (for TVs, a full frontal picture while the tv is turned on.)</p><p>3.&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>A clear picture of the rear of the unit</strong> (All edges must be visible.)</p><p>4.&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>A clear and readable picture of the model # and serial # sticker</strong> (located at the back of the unit)</p><p>5.&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>A clear picture/video clip of the defect/issue.</strong></p><p>6.&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>And a detailed explanation of the defect/issue.</strong></p><p>&nbsp;</p><p>Also, kindly include filling out the information below:&nbsp;<i>*must be a physical address</i></p><p><strong>Name:&nbsp;</strong></p><p><strong>Address:</strong></p><p><strong>City:</strong></p><p><strong>State/Province:&nbsp;</strong></p><p><strong>Zip/Postal code:&nbsp;</strong>(Please specify if you have a 5 or 9 digits zip codes to avoid delay in processing your claims)</p><p><strong>Phone#:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p><p>&nbsp;</p><p>An email with warranty instructions will be provided to you as soon as we receive the complete documentation as required above.</p><p><strong>For your reference, please see the complete overview of our warranty process attached to this email.</strong></p><p>&nbsp;</p><p><i>** please ensure that the Case File Number is in the subject line **</i></p><p><i>**Note -Please do not throw/recycle the unit until all the required information has been validated. You will receive a notification to do so when we have already received and verified all the important information. If the unit is disposed of or is no longer with you, we cannot assist you further with your claim.**</i></p><p><i>**Note - We are open from 9 AM - 6 PM EST, Mondays to Fridays. Response time would be 48 to 72 business hours.</i></p><p>Thank you,</p><p><strong>Customer Support</strong></p><p>Curtis International Ltd.</p>',0,'2022-10-06 22:37:25','2022-10-06 22:37:25'),
